import React, { useState } from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import ProtectedRoute from './ProtectedRoute';
import LoginRegisterPage from './components/LoginRegisterPage';
import HomePage from './components/Home'; // Importe ta page d'accueil
// import ProfilePage from './components/ProfilePage'; // Importe ta page de profil

const App = () => {
    const [isAuthenticated, setIsAuthenticated] = useState(false); // État pour vérifier si l'utilisateur est connecté

    return (
        <BrowserRouter>
            <Routes>
                <Route path="/login" element={<LoginRegisterPage isAuthenticated={isAuthenticated} />} />
                <Route path="/" element={<HomePage isAuthenticated={isAuthenticated} />} />
                {/* <ProtectedRoute path="/profile" element={<ProfilePage />} isAuthenticated={isAuthenticated} /> */}
            </Routes>
        </BrowserRouter>
    );
};

export default App;
